import React from 'react';
import ReactDOM from 'react-dom';
import 'normalize.css';
import './defaults.css';
import Shop from './Shop';
import {BrowserRouter} from 'react-router-dom';
import Add from './Add';

ReactDOM.render(
  <BrowserRouter>
    <Shop/>
    <Add/>
  </BrowserRouter>,
  document.getElementById('root')
);
